import React, { useState, useEffect } from 'react'

const Popup = (isPopupOpen) => {
    return (
        <div>
            {isPopupOpen && (
                <div>
                    <div>
                        This is the content of the pop-up.
                    </div>
                    <button onClick={() => setIsOpen(false)}>
                        Close Pop-up
                    </button>
                </div>
            )}
        </div>
    )
}

export default Popup
